The following statement contains a magic number: if (orbit.referenceBody.atmosphere && orbit.PeA < orbit.referenceBody.atmosphereDepth && orbit.ApA > orbit.referenceBody.atmosphereDepth)              {                  double tA = orbit.TrueAnomalyAtRadius(orbit.referenceBody.atmosphereDepth + orbit.referenceBody.Radius);                  //log.buf.AppendFormat("tA = {0}
"' tA);                  double utTime = Planetarium.GetUniversalTime();                  //log.buf.AppendFormat("utTime = {0}
"' utTime);                  double timeAtRad1 = orbit.GetUTforTrueAnomaly(tA' orbit.period * 0.5);                  //log.buf.AppendFormat("timeAtRad1 = {0}
"' timeAtRad1);                  if (timeAtRad1 < utTime)                  {                      timeAtRad1 += orbit.period;                      //log.buf.AppendFormat("timeAtRad1 = {0}
"' timeAtRad1);                  }                  double timeAtRad2 = orbit.GetUTforTrueAnomaly(-tA' orbit.period * 0.5);                  //log.buf.AppendFormat("timeAtRad2 = {0}
"' timeAtRad2);                  if (timeAtRad2 < utTime)                  {                      timeAtRad2 += orbit.period;                      //log.buf.AppendFormat("timeAtRad2 = {0}
"' timeAtRad2);                  }                  double time = Math.Min(timeAtRad1' timeAtRad2) - utTime;                  //log.buf.AppendFormat("time = {0}
"' time);                    if (Double.IsNaN(time))                  {                      str = "---s";                      //log.buf.AppendLine("time is NaN");                  }                  else                  {                      str = TimeFormatter.ConvertToString(time);                      //log.buf.AppendFormat("str = {0}
"' str);                  }              }              else              {                  str = "---s";                  //log.buf.AppendLine("no atmosphere' pe > atmosphere' or ap < atmosphere");              }

